import React from 'react'

export default function GameOver(props) {
  if (props.show) {
    return (
      <div id="gameover">
        <h1>Fim de jogo! O { props.winner  } ganhou</h1>
        <button>Jogar novamente</button>
      </div>
    )
  }
}
